DROP TABLE IF EXISTS doctor
CREATE TABLE doctor (id INTEGER PRIMARY KEY, first_name VARCHAR(50), middle_name VARCHAR(50), last_name VARCHAR(50), address1 VARCHAR(50), phone_number VARCHAR(50), age VARCHAR(50),sex VARCHAR(50), school_attended VARCHAR(50), academic_degree VARCHAR(50), speciality_area VARCHAR(50), availablity_after_hours VARCHAR(50), personality_type VARCHAR(50), patients_saved VARCHAR(50), patients_served VARCHAR(50), fatalities VARCHAR(50), years_of_experience VARCHAR(50), positive_reviews VARCHAR(50), negative_reviews VARCHAR(50), office_location VARCHAR(50));
